interface Props {
    id: string;
    title: string;
    completed: boolean;
    toggleCompleted: (id: string, completed: boolean) => void;
}

export function TaskItem({ id, title, completed, toggleCompleted }: Props) {

    return (
        <div>
            <li>
                <input
                    type="checkbox"
                    checked={completed}
                    onChange={(e) => toggleCompleted(id, e.target.checked)} />
                {title}
                <button>Edit</button>
                <button>Delete</button>
            </li>
        </div>
    );
}
